
<script>
const foldingData = [{},{}] // 0 : source->target, 1 : target->source
const nodeData = {} // id => data

let depth = 7;
let current = ""

const t = {
	updateDepth : () => {
		depth = Number(document.querySelector("#depthInput").value)
		t.updateScreen();
	},
	refineData : () => {
		originData.edgeList.map(x => {
			util.forcePush(foldingData[0], x.data.source, x.data.target)
			util.forcePush(foldingData[1], x.data.target, x.data.source)
		})
		originData.nodeList.map(x => {
			nodeData[x.data.id] = x
		})
	},
	selectNode : (id) => {
		current = id;
		t.updateScreen();
	},
	updateScreen : () => {
		t.measurePerformance("Recursive Find", t.findNearNodes, [current, "", depth])
		t.measurePerformance("Filter Unique", t.filterUniqueNodes, t.findNearNodes(current, "", depth))
		t.measurePerformance("Sort by Dist", t.sortNodesByDist, [t.filterUniqueNodes(t.findNearNodes(current, "", depth)), depth])

		t.displayNodeByDist(t.sortNodesByDist(t.filterUniqueNodes(t.findNearNodes(current, "", depth)), depth))
	},
	displayNodeByDist : (nodes) => {
		let output = "<table id=list><tr><td>Path</td><td>ID</td><td>FoldName</td></tr>";
		for(let i=0; i<nodes.length; i++){
			output += `<tr><td class=dist colspan=3>Dist ${i}</td></tr>`
			nodes[i].map(x => {
				output += `<tr><td>${x[1]}</td><td>${x[0]}</td><td>${nodeData[x[0]].data.foldNode.title}</td></tr>`
			})
		}
		output += "</table>";
		document.querySelector("#disp").innerHTML = output
	},
	sortNodesByDist : (nodes, limit) => {
		const result = [];
		nodes.map(x => {
			util.forcePush(result, limit - x[2], [x[0], x[1]])
		})
		return result
	},
	filterUniqueNodes : (nodes) => {
		const temp = {}
		nodes.map(x => {
			if(!temp[x[0]] || temp[x[0]][2] < x[2]){
				temp[x[0]] = x
			}
		})
		return Object.keys(temp).map(key => temp[key])
	},
	findNearNodes : (curr, path, limit) => {
		return [[curr, path, limit], ...(limit == 0?[]:[0,1]).map(i => foldingData[i][curr] ?
			foldingData[i][curr].map(x => t.findNearNodes(x, `${path}${i}`, limit-1))
		:[]).flat(2)]
	},
	randomNode : () => {
		t.selectNode(originData.edgeList[Math.floor(Math.random() * originData.edgeList.length)].data.source);
	},
	measurePerformance : (subject, func, args = []) => {
		const start = +new Date()
		func(...args);
		console.log(`${subject} : elapsed ${+new Date() - start}ms`)
	}
}
const util = {
	forcePush : (arr, key, data) => {
		if(!arr[key]){arr[key] = []}
		arr[key].push(data)
	}
}

window.onload = () => {
	document.querySelector("#depthInput").value = depth;
	t.measurePerformance("Refine Data", t.refineData);
	t.randomNode()
}
</script>
